import React from 'react';

import UsersLIst from '../components/UsersList';

const Users = () => {
  const USERS = [
    {
      id: 'u1',
      name: 'Max',
      image:
        'https://www.google.com/imgres?imgurl=https%3A%2F%2Fi.pinimg.com%2Foriginals%2Fd9%2Ffa%2F25%2Fd9fa25e9d547770a13f00e69c2fe0741.jpg&imgrefurl=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F151715081167325984%2F&tbnid=A32sO9OnAwV-5M&vet=12ahUKEwjc8LOS5-LnAhUa04UKHeRcC9kQMygBegUIARCKAg..i&docid=vp1Q9G2rsQ0zzM&w=570&h=570&q=flowers&hl=en&ved=2ahUKEwjc8LOS5-LnAhUa04UKHeRcC9kQMygBegUIARCKAg',
      place: '3',
    },
  ];

  return <UsersLIst items={USERS} />;
};

export default Users;
